import React from 'react'

import styles from './Messages.module.css'
import DialogItem from '../DialogsList/DialogItem'
import Dialog from './Dialog'









const Messages = (props) => {
    debugger;
    let dialogItems = props.dialogItemsData.map((item, index) => <DialogItem setDialogID={props.setDialogID}   key={index+1} name={item.name} id={item.id} />)


    return <div className={styles.messages}>
        {props.currentDialogId === 0
            ? 'chose dialog please'
            : <Dialog sendMessage={props.sendMessage} id={props.currentDialogId} messages={props.dialogItemsData[props.currentDialogId-1].messages} />}

        <div className={styles.dialogItems}>
            <div className={styles.dialogSearch}></div>
            <div className={styles.dialogsList}>
                {dialogItems}

            </div>
        </div>
        
    </div>
}


export default Messages;
